/**
 * Status of API
 * @export
 * @interface Status
 */
export interface Status {
    [key: string]: any;
    /**
     *
     * @type {number}
     * @memberof Status
     */
    'version'?: number;
    /**
     *
     * @type {string}
     * @memberof Status
     */
    'timestamp'?: string;
    /**
     *
     * @type {boolean}
     * @memberof Status
     */
    'online'?: boolean;
}
